import React, {component, Component} from 'react';

class APIcall extends Component
{
    constructor(props){
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items:[]
        }
    }

componentDidMount(){
    fetch("api.openweathermap.org/data/2.5/weather?q=Skopje&appid=5028b23243c12ce9c01337e4bf4ea0ae")
        .then(res => res.json)
        .then(
            (result) => {
                console.log(result)
                this.setState({
                    isLoaded: true,
                    items: result
                })
            })
}

}


export default APIcall
